import React from 'react';
import { Container, Row, Col, Form, Button, Navbar, Nav } from 'react-bootstrap';

import '../../styles/components/admin_navbar.module.scss';

const AdminNavbar = () => {
	return (
		<Navbar className={`${styles.admin_navbar} d-flex justify-content-between border-bottom`}> 
			<Navbar.Brand href="#home">Dominic Cattell</Navbar.Brand>
			<Nav>
				<Nav.Link eventKey="/admin/dashboard" href="#home">Home</Nav.Link>
				<Nav.Link href="#home">Logout</Nav.Link>
			</Nav>
		</Navbar>
	);
};

export default AdminNavbar;
